import React from "react";
import Todo from "./todo";

function TodoList({ todos, toggleTodo }) {
  return todos.map((todo) => {
    return <Todo todo={todo} toggleTodo={toggleTodo} key={todo.id}></Todo>;
  });
}

export default TodoList;
